css:
.atom-color-highlight {
  z-index: 100;
  position: relative;
}
.atom-color-highlight .region {
  -webkit-font-smoothing: antialiased;
  position: absolute;
  padding: 0px 2px;
  margin-left: -1px;
  display: inline-block;
  line-height: inherit;
  box-sizing: content-box;
  border-radius: 2px;
  z-index: -2;
  white-space: pre;
}
.atom-color-highlight .region:before {
  content: '';
  display: block;
  position: absolute;
  width: 100%;
  height: 100%;
  background: url(atom://atom-color-highlight/resources/transparent-background.png);
  top: 0;
  left: 0;
  z-index: -1;
  border-radius: 2px;
}
.atom-color-highlight .region:after {
  content: '';
  display: block;
  position: absolute;
  width: 100%;
  height: 100%;
  background: inherit;
  z-index: -1;
  top: 0;
  left: 0;
  border-radius: 2px;
}
